import React from 'react';
import './Index.css';
import Home from '../../assets/images/home.svg';

const Header = () => {
  return (
    <header className="main-header">
      <div className= "content">
        <nav>
          <ul>
            <li><img src={Home}/></li>
          </ul>    
        </nav>
      </div>
    </header>
  );
}

export default Header;
